import React from 'react';
import { Grid, Paper } from '@material-ui/core';

const SignUp = () => {
  return (
    <Grid container justify='space-around'>
      <Paper>
        <Grid container justify='space-around'>
          <h1>Sign up</h1>
        </Grid>
      </Paper>
    </Grid>
  );
};

export default SignUp;
